const VectorIcon = () => {
  return (
    <svg
      width="6"
      height="8"
      viewBox="0 0 6 8"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
    >
      <path
        d="M1 1L5 4L1 7"
        stroke="#7A7A7A"
        stroke-linecap="round"
        stroke-linejoin="round"
      />
    </svg>
  );
};
export default VectorIcon;
